import React from 'react'
import Menu from '../Menu/index'
import './header.css'
import Barra from '../Barra'
import Primeiro from '../../Primeiro'
import Segunda from '../../Segunda'
import Mais from '../../Mais'

function Header(){
    return (
        <div className="container">
            <Menu />
            <Barra />
            <Primeiro />
            <Segunda />
            <Mais />
        </div>
    );
}
export default Header;
